import { Group } from "@mui/icons-material";
import { Avatar, Card, CardContent, Grid, Typography } from "@mui/material";

const CreateTeam = () => {
    return (
        <Grid item sx={12} md={4}>
            <Card>
                <CardContent>
                    <Avatar>
                        <Group />
                    </Avatar>
                </CardContent>
            </Card>
        </Grid>
    ); 
};

export default CreateTeam;
